import React from "react";
import css from "./style.module.css";

const BurgerIngredient = (props) => {
  if (props.type === "salad")
    return <div className={css.salad}>{props.type}</div>;
  else if (props.type === "chesse")
    return <div className={css.chesse}>{props.type}</div>;
  else if (props.type === "bread-top")
    return <div className={css.breadTop}></div>;
  else if (props.type === "becon")
    return <div className={css.becon}>{props.type}</div>;
  else if (props.type === "meat") return <div className={css.meat}></div>;
  else if (props.type === "burgerBotton")
    return <div className={css.burger - botton}></div>;
  return <div>{props.type}</div>;
};

export default BurgerIngredient;
